	public String getRandomString(int length) {
		String all = "abcdefghijklmnopqrstuvwxyz0123456789";
		StringBuilder sb = new StringBuilder();

		for (int i = 0; i < length; i++) {
			int randomNum = ThreadLocalRandom.current().nextInt(0, all.length());
			sb.append(String.valueOf(all.charAt(randomNum)));

		}

		return sb.toString();
	}

	public Cookie getCFBMCookie() {
		long date = Instant.now().getEpochSecond() + 1200;

		String example = "wR1shb_wUMbQB7dgjjZ2kKaP.8ketPwLBIteRw095qw-1647177029-0-AS3F+35H67wZ18q9qhf7ILmSDwjizOZW7/5ZbyDHZjEWrMsWZ9A5xcW7RI0udz0ULnnExuTV84bBCKOXmiGP4R8fBU+66vU0Nl78PV9suwtYGr35hWV9Yj4axcAbJUmaFQ==";
		String letters = "ABCDEFGHIJKLMNOPQPRSTUVWXYZabcdefghijklmnopqprstuvwxyz";
		String ints = "1234567890";
		StringBuilder sb = new StringBuilder();

		for (int i = 0; i < example.length(); i++) {
			String currentChar = String.valueOf(example.charAt(i));
			int randomNumLetters = ThreadLocalRandom.current().nextInt(0, letters.length());
			int randomNumInts = ThreadLocalRandom.current().nextInt(0, ints.length());

			if (letters.contains(currentChar)) {
				sb.append(String.valueOf(letters.charAt(randomNumLetters)));
			} else if (ints.contains(currentChar)) {
				sb.append(String.valueOf(ints.charAt(randomNumInts)));

			} else {
				sb.append(currentChar);
			}

		}

		Cookie __cf_bm = new Cookie("discord.com", "/", "__cf_bm", sb.toString(), date, true, true);
		return __cf_bm;
	}

