	public String getEmoji(String providedName) throws Exception {
		JSONArray array = new JSONArray(new JSONTokener(getEmojisJSON()));

		for (int i = 0; i < array.length(); i++) {
			JSONObject o = new JSONObject(new JSONTokener(array.get(i).toString()));
			String name = o.getString("name");
			String emojiUrlEncoded = o.getString("emojiUrlEncoded");

			if (name.equals(providedName)) {
				return emojiUrlEncoded;
			}
		}

		return null;
	}
